import { Suspense } from 'react';
import Suspended from '../common/Suspended';
import { cn } from '@/lib/utils';

export default function SearchPageLayout({
  title,
  searchCriteriaContent,
  smartFiltersContent,
  mainSectionContent,
  footerContent,
  hideSmartFilters,
}: {
  title: string;
  searchCriteriaContent: React.ReactNode;
  smartFiltersContent?: React.ReactNode;
  mainSectionContent: React.ReactNode;
  footerContent?: React.ReactNode;
  hideSmartFilters?: boolean;
}) {
  return (
    <div className="flex h-full w-full flex-col gap-4 overflow-hidden bg-accent p-4">
      {/* Top control panel */}
      <div className="flex w-full shrink-0 items-start gap-4">
        {/* Bordered search box */}
        <div className="flex-1 rounded-lg border bg-background p-4">
          <h2 className="mb-4 font-semibold text-lg">{title}</h2>
          <div className="flex flex-col gap-4">
            {/* Slot for search form inputs AND buttons */}
            <div>
              <Suspense fallback={<Suspended name="SearchCriteria" />}>{searchCriteriaContent}</Suspense>
            </div>
          </div>
        </div>
      </div>

      {/* Smart search / filter bar */}
      {!hideSmartFilters && (
        <div className="flex min-h-14 shrink-0 items-center gap-2 rounded-lg border bg-background px-4 py-1">
          <Suspense fallback={<Suspended name="SmartSearch" />}>{smartFiltersContent}</Suspense>
        </div>
      )}

      {/* Main results area */}
      <div className={cn('main relative flex flex-1 flex-col overflow-hidden', 'rounded-lg border bg-background')}>
        <div className="relative flex-1 overflow-auto">
          <Suspense fallback={<Suspended name="MainContent" />}>{mainSectionContent}</Suspense>
        </div>
        <div className="shrink-0 border-t">
          <Suspense fallback={<Suspended name="FooterContent" />}>{footerContent}</Suspense>
        </div>
      </div>
    </div>
  );
}
